import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../welcome/Welcome.css";
import { Link  } from "react-router-dom";
import slick1 from "../images/spotlight-pregnancy-symptoms-2021.png";
import babyname from "../images/spotlight-pregnancy-symptoms-2021.png";
import ovulation from "../images/ovulation-calcutor.png";
import growth from "../images/Height-and-weight-chart_3x.png.pagespeed.ce.UaksTMzqRr.png";
import duedate from "../images/duedate.png";


export default class MultipleItems extends Component {
    render() {
      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
      };
      return (
        <div className="container">
          <Slider {...settings}>
          <div><Link to="/babynamefinder">
                  <img src={slick1} className="d-block w-100" alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={slick1} className="d-block w-100" alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={slick1}  className="d-block w-100" alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={slick1} className="d-block w-100" alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={slick1}  alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={slick1} alt="logo" width="200" height="200"/>
                 </Link></div>
          </Slider>
        </div>
      );
    }
  }
